import React from 'react';
import ReactDOM from 'react-dom';

// js libs
import 'bootstrap';

// style
import 'bootstrap/dist/css/bootstrap.min.css';
import './css/custom.css';

//components
import App from "./screens/app";

ReactDOM.render(<App />, document.getElementById('root'));
